/*
 * Connection-management functions
 */
static  void bench_thc_export_cb(void *st, errval_t err, iref_t iref)
{
    struct bench_thc_export_info *info;
    info = ((struct bench_thc_export_info *)(st));
    thc_lock_acquire(&(info->info_lock));
    if (err_is_fail(err)) {
        info->err = err;
    } else {
        if ((info->service_name) != NULL) {
            info->err = nameservice_register(info->service_name, iref);
        }
        if ((info->iref_ptr) != NULL) {
            *(info->iref_ptr) = iref;
        }
    }
    thc_sem_v(&(info->export_cb_done_sem));
}

static  errval_t bench_thc_connect_cb(void *st, struct bench_binding *b)
{
    struct bench_thc_export_info *info;
    info = ((struct bench_thc_export_info *)(st));
    thc_sem_p(&(info->accept_call_present_sem));
    thc_lock_acquire(&(info->info_lock));
    *(info->b) = b;
    thc_sem_v(&(info->connect_cb_done_sem));
    return(SYS_ERR_OK);
}

 errval_t bench_thc_export(struct bench_thc_export_info *info, const char *service_name, struct waitset *ws, idc_export_flags_t flags, iref_t *iref_ptr)
{
    errval_t err;
    thc_sem_init(&(info->export_cb_done_sem), 0);
    thc_sem_init(&(info->connect_cb_done_sem), 0);
    thc_sem_init(&(info->accept_call_present_sem), 0);
    thc_lock_init(&(info->info_lock));
    thc_lock_init(&(info->next_accept_lock));
    info->service_name = service_name;
    info->err = SYS_ERR_OK;
    info->iref_ptr = iref_ptr;
    err = bench_export(info, bench_thc_export_cb, bench_thc_connect_cb, ws, flags);
    if (err_is_ok(err)) {
        thc_sem_p(&(info->export_cb_done_sem));
        err = (info->err);
        thc_lock_release(&(info->info_lock));
    }
    return(err);
}

 errval_t bench_thc_accept(struct bench_thc_export_info *info, struct bench_binding **b)
{
    struct bench_binding *priv_b;
    thc_lock_acquire(&(info->next_accept_lock));
    info->b = (&priv_b);
    thc_sem_v(&(info->accept_call_present_sem));
    thc_sem_p(&(info->connect_cb_done_sem));
    errval_t err = info->err;
    thc_lock_release(&(info->info_lock));
    thc_lock_release(&(info->next_accept_lock));
    if (err_is_ok(err)) {
        if (b != NULL) {
            *b = priv_b;
        }
    }
    return(err);
}

static  void bench_thc_bind_cb(void *st, errval_t err, struct bench_binding *b)
{
    struct bench_thc_connect_info *info;
    info = ((struct bench_thc_connect_info *)(st));
    info->err = err;
    if (err_is_ok(err)) {
        info->b = b;
    }
    thc_sem_v(&(info->bind_cb_done_sem));
}

 errval_t bench_thc_connect(iref_t iref, struct waitset *ws, idc_bind_flags_t flags, struct bench_binding **b)
{
    struct bench_thc_connect_info info;
    errval_t err;
    thc_sem_init(&(info.bind_cb_done_sem), 0);
    info.err = SYS_ERR_OK;
    info.b = NULL;
    err = bench_bind(iref, bench_thc_bind_cb, &info, ws, flags);
    if (err_is_ok(err)) {
        thc_sem_p(&(info.bind_cb_done_sem));
        err = (info.err);
        if (err_is_ok(err)) {
            if (b != NULL) {
                *b = (info.b);
            }
        }
    }
    return(err);
}

 errval_t bench_thc_connect_by_name(const char *service_name, struct waitset *ws, idc_bind_flags_t flags, struct bench_binding **b)
{
    errval_t err;
    iref_t iref;
    err = nameservice_blocking_lookup(service_name, &iref);
    if (err_is_ok(err)) {
        err = bench_thc_connect(iref, ws, flags, b);
    }
    return(err);
}


